import React from 'react'

export default function ProfileBanner({profileURL, schoolURL, name, dormName, adress, email}) {
  return (
    <div>
      <div className="profile flex">
        <img class="ui medium circular image center" src="https://dornsife.usc.edu/tools/mytools/PersonnelInfoSystem/DOC/Student/PHIL/photo_1078846.jpg"/>
      </div>
    </div>
  )
}
